import { FETCH_PRODUCTS } from "../types";

const thumbNailsReducer = (state = [], action) => {
  switch (action.type) {
    case FETCH_PRODUCTS:
      return action.payload;
    default:
      return state;
  }
};

export default thumbNailsReducer;
